        return (
            <>
                <aside className="VideoList">
                    <h3 className="VideoList__main-title">NEXT VIDEO</h3>

                    {VideoArray.filter(video => {
                    if (video === video[this.props.data]) {
                        return false;} return true;}).map(video =>
                    <Video 
                        key = {video.id}
                        id = {video.id}
                        title={video.title}
